import React from "react";
import "GoalList.css";

const GoalList = () => {
	return (
		<ul className="goal-list">
	  	<li>Finish the course</li>
	  	<li>Learn a lot</li>
	  	<li>Eearn money :v</li>
	  </ul>
	);
};

export default GoalList;
